<style>
:global(body) {
  margin: 0;
  padding: 0;
  font-family: 'Poppins', sans-serif;
  background: #161616;
}

h1 {
    color: white;
    text-align: center;
    font-size: clamp(2em, 5vw, 3em);
    margin-top: 20px;
    margin-bottom: 0;
}
svg {
    height: 80vh;
    width: 100%;
    justify-self: center;
}

.light {
    opacity: .2;
    animation: lightsOn .5s ease-in forwards;    
    animation-delay: calc(0.05s * (sibling-index() - 365));
    filter: 
        drop-shadow(0 0 1px color-mix(in srgb, var(--lamp-kleur), transparent 0%))
        drop-shadow(0 0 2px color-mix(in srgb, var(--lamp-kleur), transparent 20%))
        drop-shadow(0 0 3px color-mix(in srgb, var(--lamp-kleur), transparent 40%))
        drop-shadow(0 0 4px color-mix(in srgb, var(--lamp-kleur), transparent 60%))
        drop-shadow(0 0 5px color-mix(in srgb, var(--lamp-kleur), transparent 80%));

    fill:var(--lamp-kleur);
}

.light:nth-of-type(3n) {
    --lamp-kleur:#f00;
}
